        for (i in 1..10) {
            list.add(
                Superhero(
                    "Batman",
                    "data:image/jpeg;base64,"
                )
            )
            list.add(
                Superhero(
                    "Spider Man",
                    "data:image/jpeg;base64,"
                )

            )
            list.add(
                Superhero(
                    "Super Man",
                    "data:image/jpeg;base64,"
                )
            )
        }
        return list
    }
}